init_drizzle_orm();
init_db2();
init_VideoFile();
init_FileDir();
var videoFileWithRelations = {
  fileDir: { columns: { id: true, path: true } },
  videoFileUnique: {
    with: {
      videoUniqueContents: {
        with: { video: true }
      }
    }
  }
};
var VIDEO_FILE_SORT_KEYS = ["id", "fileKey", "uniqueId", "fileSize", "videoDuration", "createdAt", "updatedAt"];
function buildVideoFileOrderBy(sortBy, sortOrder) {
  const col = sortBy && VIDEO_FILE_SORT_KEYS.includes(sortBy) ? sortBy : "id";
  const isAsc = sortOrder === "asc";
  return (t2, op) => isAsc ? [op.asc(t2[col])] : [op.desc(t2[col])];
}
function toVideoFileResponse(item) {
  if (!item)
    return null;
  const { videoFileUnique, fileDir, ...videoFile } = item;
  const video = videoFileUnique?.videoUniqueContents?.[0]?.video ?? null;
  const videoObj = video;
  const thumbnailKey = videoObj?.thumbnailKey ?? (videoFile.uniqueId ? `${videoFile.uniqueId}.jpg` : null);
  return { ...videoFile, video, fileDir, thumbnailKey };
}

class VideoFilesService {
  async findManyPaginated(page, pageSize, offset, sortBy, sortOrder) {
    const orderByFn = buildVideoFileOrderBy(sortBy, sortOrder);
    const [items, total] = await Promise.all([
      db2.query.videoFilesTable.findMany({
        orderBy: orderByFn,
        limit: pageSize,
        offset,
        with: videoFileWithRelations
      }),
      db2.$count(videoFilesTable)
    ]);
    return { page, pageSize, total: total ?? 0, items: items.map((it) => toVideoFileResponse(it)) };
  }
  async searchPaginated(keyword, page, pageSize, offset, sortBy, sortOrder) {
    const dirsWithPath = await db2.select({ id: fileDirsTable.id }).from(fileDirsTable).where(ilike(fileDirsTable.path, `%${keyword}%`));
    const dirIds = dirsWithPath.map((d) => d.id);
    const conditions2 = [
      ilike(videoFilesTable.fileKey, `%${keyword}%`),
      ilike(videoFilesTable.uniqueId, `%${keyword}%`)
    ];
    if (dirIds.length > 0) {
      conditions2.push(inArray(videoFilesTable.fileDirId, dirIds));
    }
    const condition = or(...conditions2);
    const orderByFn = buildVideoFileOrderBy(sortBy, sortOrder);
    const [items, total] = await Promise.all([
      db2.query.videoFilesTable.findMany({
        where: condition,
        orderBy: orderByFn,
        limit: pageSize,
        offset,
        with: videoFileWithRelations
      }),
      db2.$count(videoFilesTable, condition)
    ]);
    return { page, pageSize, total: total ?? 0, items: items.map((it) => toVideoFileResponse(it)) };
  }
  async findById(id) {
    const item = await db2.query.videoFilesTable.findFirst({
      where: eq(videoFilesTable.id, id),
      with: videoFileWithRelations
    });
    return toVideoFileResponse(item);
  }
  async findByIdRaw(id) {
    return db2.query.videoFilesTable.findFirst({
      where: eq(videoFilesTable.id, id)
    });
  }
}
